import React from 'react'
import User from './User'
import './style.css'

class App extends React.Component {
	constructor() {
		super();

		this.state = {
			users: [
        {name: 'Коля', surname: 'Иванов', salary: 100, days: 5},
				{name: 'Вася', surname: 'Петров', salary: 400, days: 10},
				{name: 'Петя', surname: 'Сидоров', salary: 200, days: 7},
      ]
		};
	}

  render() {
   const table = this.state.users.map((item, index) => {
      <Users
          name={item.name}
          surname={item.surname}
          salary={item.salary}
          days={item.days}
          key={index}
      />
   })

		return <div>
			{table}
		</div>;
	}
}

export default App;
